of:\n	+ Sadness/Tiredness/Melancholy (emotional pain)\n* The statement \"and stay up late\" implies a sense of:\n	+ Frustration/Anxiety/Worry (feeling stuck and unable to cope)\n\n**Intensity of emotions:**\n\n* Medium-high intensity for the emotional pain/sadness (it\'s affecting daily life, causing difficulty sleeping)\n* Low-medium intensity for the frustration/anxiety/worry (more of a feeling of being stuck rather than intense anxiety)\n\n**Suggestions:**\n\nConsidering the emotional pain and feelings of being stuck, it might be helpful to:\n\n1. Encourage self-care practices before bedtime, such as relaxation techniques or calming activities, to help manage emotional pain.\n2. Suggest gentle exercises or stretching routines to help regulate sleep patterns.\n3. Explore stress-reducing strategies or mindfulness practices during the day to alleviate feelings of frustration and anxiety.\n\nPlease feel free to provide more context or additional dialogue, and I\'ll be happy to continue analyzing the emotions and providing suggestions!','user',1,'en','psychology','{\"links\": [{\"url\": \"https://askuon.newcastle.edu.au/\", \"title\": \"Mental Health Services\"}, {\"url\": \"https://askuon.newcastle.edu.au/\", \"title\": \"Student Counseling Appointment\"}]}','2025-11-23 16:47:29'),(152,'4cce3785c73ccfa825b0d0f484174105045017bd57455930cc0020ed204814d4','1313123',NULL,'user','How to book counseling?','user',0,'en',NULL,NULL,'2025-11-23 16:54:02'),(153,'4cce3785c73ccfa825b0d0f484174105045017bd57455930cc0020ed204814d4','1313123',11,'assistant','If you need mental health support, please contact the school mental health center.\n\nğŸ“ Campus counseling: 1300 653 007\nğŸš¨ 24/7 Crisis hotline: 4921 6622\n\nSeeking help is a sign of strength.','user',0,'en','psychology','{\"category\": \"psychology\", \"keywords\": [\"counseling\"]}','2025-11-23 16:54:02'),(154,'0d3371ea921f7001e4d508320052af85a32a2e1e5d9d30cc6a2f2ef4e56c0d13','1313123',NULL,'user','I feel bad','user',0,'en'