CREATE DEFINER=`uonask`@`localhost` PROCEDURE `CleanupInactiveSessions`()
BEGIN
    
    DELETE FROM user_sessions 
    WHERE last_seen < DATE_SUB(NOW(), INTERVAL 30 DAY) 
    AND is_active = FALSE;
    
    
    DELETE ch FROM conversation_history ch
    LEFT JOIN questions q ON ch.question_id = q.id
    WHERE ch.created_at < DATE_SUB(NOW(), INTERVAL 60 DAY)
    AND (q.is_psychology_related IS NULL OR q.is_psychology_related = FALSE);
END ;;
